INSERT INTO `dj_cms_addondownload` VALUES (3, '<section data-tplid=\"95266\" data-tools=\"135编辑器\"><section style=\"font-size:16px;\"><section><section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"margin:0 auto\" class=\"layout\" data-i=\"15604115281772\"><section style=\"border: 2px solid #0c0c0c;padding: 10px 0px;box-sizing:border-box;width: 100%;display:inline-block;\" data-width=\"100%\" data-i=\"15604115281773\" class=\"\"><section style=\"float:left;margin-left: 15px;\" data-i=\"15604115281774\" class=\"\"><p style=\"font-size:60px;font-weight:bold;\" data-i=\"15604115281775\"><span data-i=\"15604115281927\" style=\"color: #0c0c0c;\">创意咖啡</span></p></section><section style=\"display: block; width: 0; height: 0; clear: both;\" data-i=\"15604115281777\"></section><section style=\"text-align: right; \" data-i=\"15604115281778\" class=\"\"><section style=\"margin-top:20px;display: inline-block;border-bottom: 1px solid #0c0c0c;padding: 4px 20px;box-sizing:border-box;\" data-i=\"15604115281779\" class=\"\"><section style=\"width: 25px; height: 25px; border-radius: 50%; background-color: rgb(12, 12, 12); display: inline-block; box-sizing: border-box;\" data-i=\"15604115281780\" class=\"\"><p style=\"text-align:center;font-weight:1000;\" data-i=\"15604115281781\"><span style=\"color: #ffffff;font-size:20px;\" data-i=\"15604115281782\">♪</span></p></section><section style=\"display:inline-block;padding-left:10px;vertical-align: top;box-sizing:border-box;\" data-i=\"15604115281783\" class=\"\"><p style=\"text-align:center;line-height: 1.75em;\" class=\"135brush\" data-brushtype=\"text\" data-i=\"15604115281784\"><span style=\"background-color: rgb(252, 252, 252); color: rgb(51, 51, 51); white-space: pre-line; text-align: right; caret-color: red; font-family: &quot;microsoft yahei&quot;;\" data-i=\"15604115281840\">Creative coffee</span></p></section></section></section><section style=\"margin-top:10px;padding: 20px;box-sizing:border-box;\" class=\"135brush\" data-style=\"text-align: center; line-height: 2em;color: rgb(0, 0, 0); font-size: 16px;\" data-i=\"15604115281788\"><p style=\"text-align:left; line-height: 2em;\" data-i=\"15604115281789\"><span style=\"caret-color: red;\" data-i=\"15604115281846\">上世纪80年代，那句“味道好极了”的电视广告语，让许多中国人开始接触并喜欢上了咖啡。</span><br><span style=\"color: #0c0c0c; font-size: 16px;\" data-i=\"15604115281790\"></span></p></section></section></section></section><section><p><br></p></section><section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"text-align: center;\"><img src=\"https://image2.135editor.com/cache/remote/aHR0cHM6Ly9tbWJpei5xbG9nby5jbi9tbWJpel9naWYvbGRGYUJOU2t2SGhheFVRU0VBeXlTaEZrUjB5VndDWnlkZG5VakZwSTlGbG1QeWVaYkphUXRyVzFOdnJ5YnZPTWljemljUzlEOHZrSVM2OEdxMksxV1RrZy8w\" style=\"vertical-align: middle; width: 35%; height: 46px;\" data-width=\"35%\" data-ratio=\"0.4407894736842105\" data-i=\"15604115281980\" width=\"105\" height=\"46\" _src=\"https://image2.135editor.com/cache/remote/aHR0cHM6Ly9tbWJpei5xbG9nby5jbi9tbWJpel9naWYvbGRGYUJOU2t2SGhheFVRU0VBeXlTaEZrUjB5VndDWnlkZG5VakZwSTlGbG1QeWVaYkphUXRyVzFOdnJ5YnZPTWljemljUzlEOHZrSVM2OEdxMksxV1RrZy8w\"></section></section><section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><p style=\"text-align:justify;letter-spacing: 1.5px; line-height: 1.75em; margin: 15px;\"><span style=\"font-size: 14px;\">时至今日，咖啡的吃法已经变得多种多样，有人喜欢喝速溶咖啡，有人则乐意花点时间为自己做一杯手冲咖啡；</span></p><p style=\"text-align:justify;letter-spacing: 1.5px; line-height: 1.75em; margin: 15px;\"><span style=\"font-size: 14px;\">有人习惯在咖啡中加糖加牛奶，还有人习惯喝纯咖啡，与此同时，咖啡还作为一种风味元素融入各种饮品之中。</span></p><p style=\"text-align:justify;letter-spacing: 1.5px; line-height: 1.75em; margin: 15px;\"><span style=\"font-size: 14px;\">但不管咖啡的喝法如何变化，最重要的一点仍然是得做到“味道好极了”。今天，我们就来品尝几款“味道好极了”的咖啡饮品。</span></p></section><section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"width: 100%; padding: 1em 0px; box-sizing: border-box;\"><section style=\"text-align: center;margin-bottom: -2em;\"><section data-bgless=\"spin\" data-bglessp=\"280\" data-bgopacity=\"60%\" style=\"width:1.2em;height:2.5em;background:rgba(157,200,252,0.2);display: inline-block;\" data-i=\"15604115281992\" class=\"\"></section></section><section class=\"135bg\" style=\"background:url(https://image2.135editor.com/cache/remote/aHR0cHM6Ly9tbWJpei5xbG9nby5jbi9tbWJpel9wbmcvN1FSVHZrSzJxQzVSNjVpYnlHSk5jMkY2TVNJaWNJWUFobzVvM3YyWkRwaWJZNVVvanAzdWliZ3FnM0pRbUtYRHJRc3MzNXlvcTVBbGljZ1V6bFlYQ2ZpYVVuZkEvMD93eF9mbXQ9cG5n) repeat-y;background-size:100% ;background-position:0px 100% ;\" data-i=\"15604115281993\"><section style=\"padding: 1.8em 0.6em 1.6em; box-sizing: border-box;\" data-i=\"15604115281994\" class=\"\"><section style=\"display: flex;justify-content:space-between;align-items: center;width: 100%;overflow: hidden;\" data-width=\"100%\" data-i=\"15604115281995\" class=\"\"><section style=\"width: 53.5%;\"><section style=\"width:100%;\"><p><img src=\"https://cdn.135editor.com/uploadword/4509614/201906/5d020687-f8d4-43c5-90e0-730dac100069.jpg\" title=\"blur-caffeine-cappuccino-302900.jpg\" data-ratio=\"1.4954954954954955\" data-i=\"15604115282008\" data-op=\"change\" _src=\"https://cdn.135editor.com/uploadword/4509614/201906/5d020687-f8d4-43c5-90e0-730dac100069.jpg\"></p><p><br></p></section></section><section style=\"width: 44.5%;\" data-width=\"44.5%\" data-i=\"15604115281999\"><section style=\"width:100%;\" data-width=\"100%\" data-i=\"15604115282000\" class=\"\"><img data-ratio=\"0.9297297297297298\" style=\"width: 100%;display: block;\" src=\"https://image.135editor.com/files/users/450/4509614/201906/nMdXBTvA_Hs5V.jpg\" data-width=\"100%\" data-i=\"15604115282001\" data-op=\"change\" title=\"undefined\" alt=\"\" _src=\"https://image.135editor.com/files/users/450/4509614/201906/nMdXBTvA_Hs5V.jpg\"><img data-ratio=\"0.6648648648648648\" style=\"width: 100%;display: block;margin-top:4px;\" src=\"https://cdn.135editor.com/uploadword/4509614/201906/5d020674-11ec-4125-bc77-72feac100069.jpg\" data-width=\"100%\" data-i=\"15604115282002\" data-op=\"change\" title=\"undefined\" alt=\"\" _src=\"https://cdn.135editor.com/uploadword/4509614/201906/5d020674-11ec-4125-bc77-72feac100069.jpg\"><br></section></section></section></section></section></section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><p style=\"text-align:justify;letter-spacing: 1.5px; margin: 15px; line-height: 1.75em;\"><span style=\"font-size: 14px;\">日常饮用的咖啡，是用咖啡豆配合不同的烘焙工艺以及烹煮器具制作出来的，里面还涉及咖啡豆的品种、产地等等元素</span><span data-i=\"15604115281938\" style=\"font-size: 14px;\">，正是这些不同的元素，让咖啡形成了千差万别的风味。</span></p><p style=\"text-align:justify;letter-spacing: 1.5px; margin: 15px; line-height: 1.75em;\"><span style=\"font-size: 14px;\">可以说，品咖啡跟品茶一样，也是一门学问，而经营咖啡店，</span><span style=\"font-size: 14px;\">也成了许多人的梦想。</span></p></section><section><p><br></p></section><section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"text-align: center;\"><section style=\"display: inline-block;color: transparent;line-height: 1.75em;\" data-i=\"15604115282105\"><section style=\"padding: 9px 2px 6px; border-top: 3px solid rgb(12, 12, 12); border-bottom: 6px solid rgb(12, 12, 12); color: rgb(12, 12, 12); font-size: 38px; font-weight: bold; box-sizing: border-box;\" data-i=\"15604115282106\" class=\"\">0<span class=\"autonum\" data-i=\"15604115282107\">1</span></section></section></section></section><section><section style=\"text-align: center;\"><section style=\"display: inline-block;width:35px;\"></section></section></section><section><p><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"width: 100%;text-align:right;\" data-width=\"100%\"><section style=\"border-top: 2px solid rgb(12, 12, 12); box-sizing: border-box;\" data-i=\"15604115282123\" class=\"\"></section><section class=\"135brush\" data-brushtype=\"text\" style=\"margin-right: 1em; background: rgb(12, 12, 12); padding: 5px 1em; color: rgb(255, 255, 255); display: inline-block; border-bottom-right-radius: 10px; border-bottom-left-radius: 10px; font-size: 15px; box-sizing: border-box;\" data-i=\"15604115282124\">农田蜂蜜冰咖啡</section><section style=\"display: flex;justify-content:space-around;\"><section style=\"width: 40%;margin-top: -2.2em;\" data-width=\"40%\"><section style=\"width: 55%; height: 3.5em; margin: 0px auto; border-right: 2px solid rgb(12, 12, 12); border-left: 2px solid rgb(12, 12, 12); border-image: initial; border-top: none; border-bottom: none; box-sizing: border-box;\" data-width=\"55%\" data-i=\"15604115282127\" class=\"\"></section><section style=\"width: 100%;\" data-width=\"100%\" data-i=\"15604115282128\" class=\"\"><img style=\"width: 100%;display: block;\" src=\"https://image.135editor.com/files/users/450/4509614/201906/4I3Y97cu_g2JH.jpg\" data-ratio=\"1.367816091954023\" data-width=\"100%\" data-i=\"15604115282129\" data-op=\"change\" title=\"undefined\" alt=\"\" _src=\"https://image.135editor.com/files/users/450/4509614/201906/4I3Y97cu_g2JH.jpg\"></section></section><section style=\"flex: 1;\"><section data-autoskip=\"1\" class=\"135brush\" style=\"font-size: 14px; text-align: justify; letter-spacing: 1.5px; line-height: 1.75em; color: rgb(63, 62, 63); padding: 1em; box-sizing: border-box;\" data-i=\"15604115282131\"><p data-i=\"15604115282132\"><span style=\"caret-color: red;\" data-i=\"15604115282291\">选用农家自采的蜂蜜，先用蒸汽加热，让蜂蜜和牛奶融合，再倒入冰雪克杯中。</span><br></p><p data-i=\"15604115282132\"><br></p><p data-i=\"15604115282132\">经过冰摇、过滤之后，再加入现磨的咖啡浓液。这样就成了一杯清凉爽口、甜而不腻的蜂蜜冰咖啡</p></section></section></section></section></section><section><p data-i=\"15604115282150\"><br></p></section><section><p data-i=\"15604115282160\"><br></p></section><section><p data-i=\"15604115282170\"><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"text-align: center;\" data-i=\"15604115282152\" class=\"\"><section style=\"display: inline-block;color: transparent;line-height: 1.75em;\" data-i=\"15604115282153\"><section style=\"padding: 9px 2px 6px; border-top: 3px solid rgb(51, 51, 51); border-bottom: 6px solid rgb(51, 51, 51); color: rgb(51, 51, 51); font-size: 38px; font-weight: bold; box-sizing: border-box;\" data-i=\"15604115282154\" class=\"\">0<span class=\"autonum\" data-num=\"2\" data-i=\"15604115282155\">2</span></section></section></section></section><section><p data-i=\"15604115282166\"><br></p></section><section><p data-i=\"15604115282273\"><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"width: 100%;\" data-width=\"100%\" data-i=\"15604115282260\" class=\"\"><section style=\"border-top: 2px solid rgb(12, 12, 12); box-sizing: border-box;\" data-i=\"15604115282261\" class=\"\"></section><section class=\"135brush\" data-brushtype=\"text\" style=\"margin-left: 1em; background: rgb(12, 12, 12); padding: 5px 1em; color: rgb(255, 255, 255); display: inline-block; border-bottom-right-radius: 10px; border-bottom-left-radius: 10px; font-size: 15px; box-sizing: border-box;\" data-i=\"15604115282262\">“黑啤”咖啡</section><section style=\"display: flex;justify-content:space-around;\" data-i=\"15604115282263\"><section style=\"flex: 1;\" data-i=\"15604115282264\" class=\"\"><section data-autoskip=\"1\" class=\"135brush\" style=\"font-size: 14px; text-align: justify; letter-spacing: 1.5px; line-height: 1.75em; color: rgb(63, 62, 63); padding: 1em; box-sizing: border-box;\" data-i=\"15604115282265\"><p data-i=\"15604115282132\">用自制的苏打水，与咖啡中的油脂碰撞，让饮品产生绵密的气泡。</p><p data-i=\"15604115282132\"><br></p><p data-i=\"15604115282132\">细细品尝的话，里面还有小麦、烟熏和黑巧克力等风味，无论颜色、口感还是味道，都跟黑啤很相似。</p><p data-i=\"15604115282266\"><br></p></section></section><section style=\"width: 40%;margin-top: -2.2em;\" data-width=\"40%\" data-i=\"15604115282267\" class=\"\"><section style=\"width: 55%; height: 3.5em; margin: 0px auto; border-right: 2px solid rgb(12, 12, 12); border-left: 2px solid rgb(12, 12, 12); border-image: initial; border-top: none; border-bottom: none; box-sizing: border-box;\" data-width=\"55%\" data-i=\"15604115282268\" class=\"\"></section><section style=\"width: 100%;\" data-width=\"100%\" data-i=\"15604115282269\" class=\"\"><img style=\"width: 100%;display: block;\" src=\"https://image.135editor.com/files/users/450/4509614/201906/4I3Y97cu_g2JH.jpg\" data-ratio=\"0.6666666666666666\" data-width=\"100%\" data-i=\"15604115282270\" data-op=\"change\" title=\"undefined\" alt=\"\" _src=\"https://image.135editor.com/files/users/450/4509614/201906/4I3Y97cu_g2JH.jpg\"></section></section></section></section></section><section><p data-i=\"15604115282168\"><br></p></section><section><p data-i=\"15604115282184\"><br></p></section><section><p data-i=\"15604115282192\"><br></p></section><section><p data-i=\"15604115282194\"><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"text-align: center;\" data-i=\"15604115282186\" class=\"\"><section style=\"display: inline-block;color: transparent;line-height: 1.75em;\" data-i=\"15604115282187\"><section style=\"padding: 9px 2px 6px; border-top: 3px solid rgb(51, 51, 51); border-bottom: 6px solid rgb(51, 51, 51); color: rgb(51, 51, 51); font-size: 38px; font-weight: bold; box-sizing: border-box;\" data-i=\"15604115282188\" class=\"\">0<span class=\"autonum\" data-num=\"3\" data-i=\"15604115282189\">3</span></section></section></section></section><section><p data-i=\"15604115282200\"><br></p></section><section><p data-i=\"15604115282202\"><br></p></section><section class=\"_135editor\" style=\"border: 0px none; box-sizing: border-box;\"><section style=\"width: 100%;text-align:right;\"><section style=\"border-top: 2px solid rgb(12, 12, 12); box-sizing: border-box;\" data-i=\"15604115282123\" class=\"\"></section><section class=\"135brush\" data-brushtype=\"text\" style=\"margin-right: 1em; background: rgb(12, 12, 12); padding: 5px 1em; color: rgb(255, 255, 255); display: inline-block; border-bottom-right-radius: 10px; border-bottom-left-radius: 10px; font-size: 15px; box-sizing: border-box;\" data-i=\"15604115282124\">“上瘾”咖啡</section><section style=\"display: flex;justify-content:space-around;\" data-i=\"15604115282125\"><section style=\"width: 40%;margin-top: -2.2em;\" data-width=\"40%\" data-i=\"15604115282126\" class=\"\"><section style=\"width: 55%; height: 3.5em; margin: 0px auto; border-right: 2px solid rgb(12, 12, 12); border-left: 2px solid rgb(12, 12, 12); border-image: initial; border-top: none; border-bottom: none; box-sizing: border-box;\" data-width=\"55%\" data-i=\"15604115282127\" class=\"\"></section><section style=\"width: 100%;\" data-width=\"100%\" data-i=\"15604115282128\" class=\"\"><img style=\"width: 100%;display: block;\" src=\"https://image.135editor.com/files/users/450/4509614/201906/4I3Y97cu_g2JH.jpg\" data-ratio=\"1.367816091954023\" data-width=\"100%\" data-i=\"15604115282129\" data-op=\"change\" title=\"undefined\" alt=\"\" _src=\"https://image.135editor.com/files/users/450/4509614/201906/4I3Y97cu_g2JH.jpg\"></section></section><section style=\"flex: 1;\" data-i=\"15604115282130\" class=\"\"><section data-autoskip=\"1\" class=\"135brush\" style=\"font-size: 14px; text-align: justify; letter-spacing: 1.5px; line-height: 1.75em; color: rgb(63, 62, 63); padding: 1em; box-sizing: border-box;\" data-i=\"15604115282131\"><p data-i=\"15604115282132\">加入了奶油和焦糖，质地浓稠、香味浓郁。刚做出来的时候，对于如何命名，一直拿不定主意。</p><p><br></p><p>后来发现许多人喝完都非常喜欢，才决定起这个名，意思是好喝得让人上瘾。</p></section></section></section></section></section><p><br></p><p><br></p><section class=\"_135editor\" style=\"border: 0px none; box-sizing: 