Mmlhd0VtYkd5NDk0czNaVmI0eGljc3NSR3NPNnRKM3R6VThXSThqYUYzRTRqTW9kM2FMcG1GVVlzV2dmQzJOR2Y3RzVpYjVKSFFuTVEvMD93eF9mbXQ9cG5n\"></section><section data-autoskip=\"1\" class=\"135brush\" style=\"font-size: 14px; text-align: justify; letter-spacing: 1.5px; line-height: 1.75em; color: rgb(1, 134, 193); padding-top: 1em; box-sizing: border-box;\"><p>跳房子，也叫跳飞机，是一种世界性的儿童游戏，也是中国民间传统的体育游戏之一，趣味性、娱乐性极强，曾深受广大儿童的喜爱。有时就算在一块空地上，只要有一根粉笔或树枝，小朋友亦会在地上画起“跳房子”的九个格，然后一起玩。</p></section></section></section></section><section style=\"border: 0px none; box-sizing: border-box;\"><p><br></p><p><br></p></section><section class=\"_135editor\"><section data-bgless=\"spin\" data-bglessp=\"20\" data-bgopacity=\"60%\" style=\"background-color: rgba(254, 254, 254, 0.6); border-top-left-radius: 10px; border-top-right-radius: 10px; border-bottom-right-radius: 10px; border-bottom-left-radius: 10px; padding: 12px; box-sizing: border-box; background-position: initial initial; background-repeat: initial initial;\"><section style=\"display: flex; justify-content: center; align-items: center; padding: 1em 0px; box-sizing: border-box;\"><section style=\"display: inline-block;width:3em;transform: rotate(0deg);-webkit-transform: rotate(0deg);-moz-transform: rotate(0deg);-ms-transform: rotate(0deg);-o-transform: rotate(0deg);\"><img style=\"width: 100%;display: block;\" src=\"https://image2.135editor.com/cache/remote/aHR0cHM6Ly9tbWJpei5xbG9nby5jbi9tbWJpel9naWYvN1FSVHZrSzJxQzduMmlhd0VtYkd5NDk0czNaVmI0eGljc0x0bUo1QTd2Nm1vRVJlcmtlQjlnWmI2WFRCMzdSTnRxMk5sekJZbmlhdTdCV2pDeWxIZXBKUUEvMD93eF9mbXQ9Z2lm\" data-ratio=\"1\" _src=\"https://image2.135editor.com/cache/remote/aHR0cHM6Ly9tbWJpei5xbG9nby5jbi9tbWJpel9naWYvN1FSVHZrSzJxQzduMmlhd0VtYkd5NDk0czNaVmI0eGljc0x0bUo1QTd2Nm1vRVJlcmtlQjlnWmI2WFRCMzdSTnRxMk5sekJZbmlhdTdCV2pDeWxIZXBKUUEvMD93eF9mbXQ9Z2lm\"></section><section class=\"135brush\" data-brushtype=\"text\" style=\"box-shadow: rgb(182, 228, 253) 0px 0px 12px; background-color: rgb(254, 254, 254); text-align: center; paddi