INSERT INTO `dj_cms_addonnews` VALUES (2, '<p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">如果是春天，阳光洒在门前</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">云雀吐出的花朵，从树梢开到红色屋顶</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">推开屋门，我们走进阳光里。和草木一样</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">发芽，拔节；和鸟儿一样，草木间吟唱</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">我采摘一些红樱桃、绿苣和蘑菇</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">你砍来枯木做柴</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">我们的红木屋就笼起人间烟火</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">你捧读诗书，我素手调羹</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">可现在是冬天，大雪封门</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">你说我们需要更旺的炉火和明天的早餐</p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">起风了，满天</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">漫过云端的想念，摇落</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">一千种关于月亮的</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">遐想。把一首诗</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">藏在蒲公英的唇边。藏进一粒</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">飘飞的种子，一朵欢笑一缕微风</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">春天来了，你</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin-bottom: 0px; text-align: justify; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;.PingFang SC&quot;;\">别走</p>', NULL);
