INSERT INTO `dj_cms_archives` VALUES (1, '', 26, 5, 0, '七部委：严禁政府部门将自身应承担的费用转嫁企业', '', '', '/uploads/b22eb110c3c9a577f7d97ad77004bb2449b4a7cb6cea0-97W5Ee_fw658GswYIB5vdp7uz9mR.png', '', '　　中新网8月5日电 据国家市场监管总局网站消息，国家市场监管总局等七部委近日联合发布通知，旨在进一步加强违规涉企收费治理。通知要求，严禁政府部门将自身应承担的费用转嫁企业承担。图为工作人员为纳税人宣讲减税政策。　李显元 摄　　通知指出，一些地方、一些部门及其下属单位、商业银行分支机构、行业协会、中介机构等，仍然存在违规收费问题，影响简政降费政策落实和营商环境优化，损害了企业正当利益。　　通知要求', '', 0, 25, 1, 0, 0, '', 1565025705, 1565067670, 1565025599, NULL, '', 'normal', 8, '张嘉,陈云', '0', '1', '1');
INSERT INTO `dj_cms_archives` VALUES (2, '', 6, 1, 0, '风采展示', '', '', '', 'test', '如果是春天，阳光洒在门前云雀吐出的花朵，从树梢开到红色屋顶推开屋门，我们走进阳光里。和草木一样发芽，拔节；和鸟儿一样，草木间吟唱我采摘一些红樱桃、绿苣和蘑菇你砍来枯木做柴我们的红木屋就笼起人间烟火你捧读诗书，我素手调羹可现在是冬天，大雪封门你说我们需要更旺的炉火和明天的早餐起风了，满天漫过云端的想念，摇落一千种关于月亮的遐想。把一首诗藏在蒲公英的唇边。藏进一粒飘飞的种子，一朵欢笑一缕微风春天来了，', 'test', 0, 12, 0, 0, 0, '', 1565066894, 1565066894, 1565066835, NULL, '', 'normal', 1, '陈云', '0', '0', '1');
