INSERT INTO `dj_cms_notify` VALUES (1, 1, '2019-08-06', '厚德楼', '陈云', '/uploads/TP网站快速开发学习路线2019-6-19lQ9uVgzXcpqvbEah.png', '<div class=\"left_zw\" style=\"margin: 0px auto; padding: 20px 0px; width: 600px; line-height: 26px; font-size: 15px; font-family: 微软雅黑; position: relative;\"><p style=\"margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px;\">　　<a target=\"_blank\" href=\"http://www.chinanews.com/\">中新网</a>8月5日电 据国家市场监管总局网站消息，国家市场监管总局等七部委近日联合发布通知，旨在进一步加强违规涉企收费治理。通知要求，严禁政府部门将自身应承担的费用转嫁企业承担。</p><div style=\"margin: 0px; padding: 0px; text-align: center;\"><a href=\"http://www.chinanews.com/photo/\" rel=\"sexylightbox[gp]\" target=\"_self\"><img alt=\"点击进入下一页\" src=\"http://i2.chinanews.com/simg/cmshd/2019/08/05/4ea841fc91d744f68b980c3845d7f9e1.jpg\" title=\" 图为工作人员为纳税人宣讲减税政策。　李显元 摄\" style=\"max-width: 580px; cursor: pointer;\"></a></div><div class=\"pictext\" style=\"margin: 20px auto 0px; padding: 10px; border: 1px solid rgb(222, 233, 242); color: rgb(85, 85, 85); font-size: 13px; line-height: 24px; text-indent: 2em;\">图为工作人员为纳税人宣讲减税政策。　李显元 摄</div><p style=\"margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px;\">　　通知指出，一些地方、一些部门及其下属单位、商业银行分支机构、行业协会、中介机构等，仍然存在违规收费问题，影响简政降费政策落实和营商环境优化，损害了企业正当利益。</p><p style=\"margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px;\">　　通知要求，国务院各部门要切实履行行业管理责任，对照有关法律法规和政策文件要求，结合财政部公布的全国政府性基金和行政事业性收费目录清单、国家发展改革委公布的政府定价的经营服务性收费目录清单，抓紧对涉企收费情况进行调研摸底，认真组织在本行业、本系统开展自查，严禁政府部门将自身应承担的费用转嫁企业承担，严禁行业协会和政府部门下属单位借用行政权力违规收费。对自查发现违规收费的，要立即整改，限期退还违规收取的费用，举一反三改进内部管理，坚决杜绝本行业、本系统出现违规收费行为。</p><p style=\"margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px;\">　　通知要求，各商业银行开展自查自纠。银保监会督促指导各商业银行总行，严格对照“七不准、四公开”要求(“七不准”：不得以贷转存、不得存贷挂钩、不得以贷收费、不得浮利分费、不得借贷搭售、不得一浮到顶、不得转嫁成本，“四公开”：收费项目公开、服务质价公开、效用功能公开、优惠政策公开)，在全行组织自查自纠，坚决清理规范商业银行分支机构违规收费行为。</p><p style=\"margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px;\">　　通知要求，地方各级人民政府要部署所属部门在官方网站统一公布下属单位收费项目、收费标准、收费依据、收费性质和具体服务内容等，自觉接受社会监督，做到收费公开透明。</p><p style=\"margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px;\">　　通知要求完善举报投诉查处机制。建立违规涉企收费举报投诉线索高效查处、信息共享、联合惩戒等工作制度，降低企业维权成本，提高监管效率。</p><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\" style=\"padding-right: 10px;\"><tbody><tr><td><div id=\"adhzh\" name=\"hzh\" style=\"margin: 0px; padding: 0px;\"><div id=\"_3gghumrxxin\" style=\"margin: 0px; padding: 0px;\"></div></div></td></tr></tbody></table><div id=\"function_code_page\" style=\"margin: 0px; padding: 20px 20px 0px; font-size: 14px; font-family: 宋体, sans-serif; text-align: center; clear: both; width: 500px; position: relative; white-space: pre-line;\"></div></div><div class=\"left_name\" style=\"margin: 0px auto; padding: 0px 10px 20px 0px; text-align: right; font-weight: 700; color: rgb(102, 102, 102); font-family: 微软雅黑; width: 600px;\"><div class=\"biaoqian\" style=\"margin: 0px; padding: 0px 10px; width: 380px; float: left; text-align: left; color: rgb(51, 51, 51);\"><p style=\"margin-bottom: 0px; padding: 0px;\"></p></div><div class=\"left_name\" style=\"margin: 0px; padding: 0px 10px 20px 0px;\">【编辑:刘羡】</div></div>', 'hidden');
INSERT INTO `dj_cms_page` VALUES (1, 0, 'page', 'FastAdmin - 基于ThinkPHP5和Bootstrap的极速后台开发框架', '', '', '', '', '<p>FastAdmin是一款基于ThinkPHP5+Bootstrap的极速后台开发框架。</p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">主要特性</h2><ul><li><p>基于<code>Auth</code>验证的权限管理系统</p><ul><li>支持无限级父子级权限继承，父级的管理员可任意增删改子级管理员及权限设置</li><li>支持单管理员多角色</li><li>支持管理子级数据或个人数据</li></ul></li><li><p>强大的一键生成功能</p><ul><li>一键生成CRUD,包括控制器、模型、视图、JS、语言包、菜单等</li><li>一键压缩打包JS和CSS文件，一键CDN静态资源部署</li><li>一键生成控制器菜单和规则</li><li>一键生成API接口文档</li></ul></li><li><p>完善的前端功能组件开发</p><ul><li>基于<code>AdminLTE</code>二次开发</li><li>基于<code>Bootstrap</code>开发，自适应手机、平板、PC</li><li>基于<code>RequireJS</code>进行JS模块管理，按需加载</li><li>基于<code>Less</code>进行样式开发</li><li>基于<code>Bower</code>进行前端组件包管理</li></ul></li><li><p>强大的插件扩展功能，在线安装卸载升级插件</p></li><li><p>通用的会员模块和API模块</p></li><li><p>共用同一账号体系的Web端会员中心权限验证和API接口会员权限验证</p></li><li><p>二级域名部署支持，同时域名支持绑定到插件</p></li><li><p>多语言支持，服务端及客户端支持</p></li><li><p>强大的第三方模块支持(<a href=\"https://www.fastadmin.net/store/cms.html\">CMS</a>、<a href=\"https://www.fastadmin.net/store/blog.html\">博客</a>、<a href=\"https://www.fastadmin.net/store/docs.html\">文档生成</a>)</p></li><li><p>整合第三方短信接口(阿里云、腾讯云短信)</p></li><li><p>无缝整合第三方云存储(七牛、阿里云OSS、又拍云)功能</p></li><li><p>第三方富文本编辑器支持(Summernote、Tinymce、百度编辑器)</p></li><li><p>第三方登录(QQ、微信、微博)整合</p></li><li><p>Ucenter整合第三方应用</p></li></ul><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">安装使用</h2><p><a href=\"https://doc.fastadmin.net/\">https://doc.fastadmin.net</a></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">在线演示</h2><p><a href=\"https://demo.fastadmin.net/\">https://demo.fastadmin.net</a></p><p>用户名：admin</p><p>密&emsp;码：123456</p><p>提&emsp;示：演示站数据无法进行修改，请下载源码安装体验全部功能</p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">界面截图</h2><p><img src=\"https://gitee.com/uploads/images/2017/0411/113717_e99ff3e7_10933.png\" alt=\"控制台\" referrerpolicy=\"no-referrer\" /></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">问题反馈</h2><p>在使用中有任何问题，请使用以下联系方式联系我们</p><p>交流社区:&nbsp;<a href=\"https://forum.fastadmin.net/\">https://forum.fastadmin.net</a></p><p>QQ群:&nbsp;<a href=\"https://jq.qq.com/?_wv=1027&amp;k=487PNBb\">636393962</a>(满)&nbsp;<a href=\"https://jq.qq.com/?_wv=1027&amp;k=5ObjtwM\">708784003</a>(满)&nbsp;<a href=\"https://jq.qq.com/?_wv=1027&amp;k=59qjU2P\">964776039</a>(3群)</p><p>Email: (karsonzhang#163.com, 把#换成@)</p><p>Github:&nbsp;<a href=\"https://github.com/karsonzhang/fastadmin\" target=\"_blank\" class=\"url\">https://github.com/karsonzhang/fastadmin</a></p><p>Gitee:&nbsp;<a href=\"https://gitee.com/karson/fastadmin\" target=\"_blank\" class=\"url\">https://gitee.com/karson/fastadmin</a></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">特别鸣谢</h2><p>感谢以下的项目,排名不分先后</p><p>ThinkPHP：<a href=\"http://www.thinkphp.cn/\">http://www.thinkphp.cn</a></p><p>AdminLTE：<a href=\"https://adminlte.io/\">https://adminlte.io</a></p><p>Bootstrap：<a href=\"http://getbootstrap.com/\">http://getbootstrap.com</a></p><p>jQuery：<a href=\"http://jquery.com/\">http://jquery.com</a></p><p>Bootstrap-table：<a href=\"https://github.com/wenzhixin/bootstrap-table\" target=\"_blank\" class=\"url\">https://github.com/wenzhixin/bootstrap-table</a></p><p>Nice-validator:&nbsp;<a href=\"https://validator.niceue.com/\">https://validator.niceue.com</a></p><p>SelectPage:&nbsp;<a href=\"https://github.com/TerryZ/SelectPage\" target=\"_blank\" class=\"url\">https://github.com/TerryZ/SelectPage</a></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">版权信息</h2><p>FastAdmin遵循Apache2开源协议发布，并提供免费使用。</p><p>本项目包含的第三方源码和二进制文件之版权信息另行标注。</p><p>版权所有Copyright &copy; 2017-2018 by FastAdmin (<a href=\"https://www.fastadmin.net/\">https://www.fastadmin.net</a>)</p><p>All rights reserved。</p>', '', 550, 225, 0, 0, 'aboutus', 'page', 1508933935, 1553769449, 1, 'normal');
