-- Table structure for dj_cms_archives
-- ----------------------------
DROP TABLE IF EXISTS `dj_cms_archives`;
CREATE TABLE `dj_cms_archives`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '会员ID',
  `channel_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '栏目ID',
  `model_id` int(10) NOT NULL DEFAULT 0 COMMENT '模型ID',
  `special_id` int(10) NOT NULL DEFAULT 0 COMMENT '专题ID',
  `title` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '文章标题',
  `style` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '样式',
  `flag` set('hot','new','recommend','top') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标志',
  `image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '缩略图',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '关键字',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '描述',
  `tags` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'TAG',
  `weigh` int(10) NOT NULL DEFAULT 0 COMMENT '权重',
  `views` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '浏览次数',
  `comments` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '评论次数',
  `likes` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '点赞数',
  `dislikes` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '点踩数',
  `diyname` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '自定义URL',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `publishtime` int(10) DEFAULT NULL COMMENT '发布时间',
  `deletetime` int(10) DEFAULT NULL COMMENT '删除时间',
  `memo` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '备注',
  `status` enum('normal','hidden','rejected','pulloff') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'normal' COMMENT '状态',
  `admin_id` int(10) DEFAULT NULL COMMENT '管理员',
  `haveread_list` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '已读人员名单',
  `user_type` enum('0','1','2','3','4','5') CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '可见范围:0=全部,1=入党申请人,2=入党积极份子,3=发展对象,4=预备党员,5=党员',
  `is_user_record` enum('1','0') CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '用户是否上传心得',
  `activity_type` enum('1','2','3') CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '1' COMMENT '活动类型',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `status`(`channel_id`, `status`) USING BTREE,
  INDEX `channel`(`channel_id`, `weigh`, `id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '内容表' ROW_FORMAT = Compact;

